import { setUserDetails } from '../Actions';

const initialState = {
    userData: []
}
const Reducer = (state = initialState, action) => {
    switch(action.type) {
        case 'user_details': 
            return {...state, data: UserDetails.data};
        default:
            return state;
    }
}

export default Reducer;
